import React from 'react'
import {Menu} from 'semantic-ui-react'

class SidePanelRight extends React.Component{

    render(){

        return(
            <Menu
                style={{width: '250px', background:'#4c3c4c'}}
                fixed='right'
                vertical
                inverted
            >

            </Menu>

        )
    }

}

export default SidePanelRight
